function Apply()
{
    var packet = [];
    
    packet[0] = 0x11;
    packet[1] = 0x01;
    packet[2] = 0x0B;
    packet[3] = 0x7E;

    device.set_endpoint(2, 0x0002, 0xff00); // lighting IF
    device.write(packet, 20);  
}
function SendGkeys(shutdown = false)
{
    var packet = [];
    packet[0] = 0x12;
    packet[1] = 0xFF;
    packet[2] = 0x0F;
    packet[3] = 0x3F;
    packet[4] = 0x00;
    packet[5] = 4;
    packet[6] = 0x00;
    packet[7] = 9; // led count
    
    for(var iIdx = 0; iIdx < vGkeyPositions.length; iIdx++){
        var iLedIdx = (iIdx * 4) + 8;
        var iKeyPosX = vGkeyPositions[iIdx][0];
        var iKeyPosY = vGkeyPositions[iIdx][1];
        var color;
        if(shutdown){
            color = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            color = hexToRgb(forcedColor)
        }else{
            color = device.color(iKeyPosX, iKeyPosY);
        }
        packet[iLedIdx] = iIdx
        packet[iLedIdx+1] = color[0];
        packet[iLedIdx+2] = color[1];
        packet[iLedIdx+3] = color[2];        
    }
                                              

    device.set_endpoint(2, 0x0002, 0xff00); // Lighting IF
    device.write(packet, 64);
    device.pause(1);
}

function SendLogoZone(shutdown = false){
    //1B 210 vLogoPositions

    for(var iIdx = 0; iIdx < 2; iIdx++){

        var color;
        if(shutdown){
            color = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            color = hexToRgb(forcedColor)
        }else{
           if(iIdx === 0) {
                color = device.color(0, 0);
           } else {
            color = device.color(4, 0);
           }
        }
        var packet = [];
        packet[0] = 0x11;
        packet[1] = 0x01;
        packet[2] = 0x0B;

        if(iIdx === 0) {
            packet[3] = 0x1B;
            packet[4] = 0xD2;
        } else {
            packet[3] = 0x19;
            packet[4] = 0x99;
        }

        packet[5] = color[0];
        packet[6] = color[1];
        packet[7] = color[2];
        packet[8] = 0xFF;    
        device.set_endpoint(2, 0x0002, 0xff00); // Lighting IF
        device.write(packet, 20);
        //Apply();

        //device.pause(1); 
    }
}

function SendMediaZones(shutdown = false){
    let zones = [
        [12,0],[14,0],[13,0],[11,0]
    ];
    for(var iIdx = 0; iIdx < zones.length; iIdx++){
        var iKeyPosX = zones[iIdx][0];
        var iKeyPosY = zones[iIdx][1];
        var color;
        if(shutdown){
            color = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            color = hexToRgb(forcedColor)
        }else{
            color = device.color(iKeyPosX, iKeyPosY);
        }
        var packet = [];
        packet[0] = 0x11;
        packet[1] = 0x01;
        packet[2] = 0x0B;

        packet[3] = 0x1B;

        packet[4] = 155+iIdx;
        packet[5] = color[0];
        packet[6] = color[1];
        packet[7] = color[2];
        packet[8] = 0xFF;    
        device.set_endpoint(2, 0x0002, 0xff00); // Lighting IF
        device.write(packet, 20);
        //Apply();

        //device.pause(1); 
    }
}
function SendPacket(shutdown = false)
{
    //1B 210 vLogoPositions

    for(var iIdx = 0; iIdx < vKeymap.length; iIdx = iIdx + 4){
        
        var packet = [];
        packet[0] = 0x11;
        packet[1] = 0x01;
        packet[2] = 0x0B;
        let zone = 0x18;
        if(vKeymap[iIdx] >= 80){zone = 0x1D;}
        if(vKeymap[iIdx] >= 88){zone = 0x1C;}
        packet[3] = zone;

        for (var index = 0; index < 4;index++) {
            let keyNumber = index+iIdx;
            var iKeyPosX = vLedPositions[keyNumber][0];
            var iKeyPosY = vLedPositions[keyNumber][1];
            var color;
            if(shutdown){
                color = hexToRgb(shutdownColor)
            }else if (LightingMode == "Forced") {
                color = hexToRgb(forcedColor)
            }else{
                color = device.color(iKeyPosX, iKeyPosY);
            }
            let keyValue = vKeymap[keyNumber]
            if(keyValue >= 80){keyValue += 24;}
            if(vKeymap[keyNumber] >= 88){keyValue -= 14;}

            packet[4 + index*4] = keyValue;
            packet[5 + index*4] = color[0];
            packet[6 + index*4] = color[1];
            packet[7 + index*4] = color[2];
            
        }    
        device.set_endpoint(2, 0x0002, 0xff00); // Lighting IF
        device.write(packet, 20);
        //Apply();

        //device.pause(1); 
    }
}





export function Render()
{    
    SendPacket();
    SendLogoZone();
    SendMediaZones();
    Apply();
}


export function Shutdown()
{
    SendPacket(true);
    SendLogoZone(true);
    SendMediaZones(true);
    Apply();
}


